void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  int status;

  *pixel_ctrl_ptr = 1;
  status = *(pixel_ctrl_ptr + 3);
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
}

void clear_screen() {
  for (int ind1 = 0; ind1 <= 319; ind1++) {
    for (int ind2 = 0; ind2 <= 239; ind2++) {
      plot_pixel(ind1, ind2, 0);
    }
  }
}

void clearscreenbackground() {
  for (int ind1 = 0; ind1 <= 319; ind1++) {
    for (int ind2 = 0; ind2 <= 239; ind2++) {
      plot_pixel(ind1, ind2, 0);
    }
  }

  if (background_counter == 0) {
    project_background0();
  } else if (background_counter == 1) {
    project_background1();
  } else if (background_counter == 2) {
    project_background2();
  }
}

