// Max and Min functions
int max(int a, int b) { return (a > b) ? a : b; }

int min(int a, int b) { return (a < b) ? a : b; }

// Custom round function
int myRound(double value) {
  if (value < 0.0) {
    return (int)(value - 0.5);
  } else {
    return (int)(value + 0.5);
  }
}

