int main() {
  // Initializations
  rover_position[0] = x;
  rover_position[1] = y;
  rover_position[2] = (int)(horizontal_speed);
  rover_position[3] = (int)(vertical_speed);

  // Double Buffer Set Up
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
  pixel_buffer_start = *pixel_ctrl_ptr;
  clear_screen();
  wait_for_vsync();
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  clear_screen();

  while (1) {
    drawMainScreen();
    int input1 = keyboard();
    if (input1 == 4) {
      break;
    }
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
  }

  while (1) {
    // Fuel Check
    clearscreenbackground();

    if (fuel < 0) {
      clear_char_buffer();
      while (1) {
        gameOverDisplay();
        int input2 = keys();
        if (input2 == 1) {
          break;
        }
        wait_for_vsync();  // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
      }
      fuel = 200;
      score = 0;
      rover_position[0] = 0;
      rover_position[1] = 0;
      vertical_speed = 1.0;
      horizontal_speed = 1.0;
      background_counter++;
      if (background_counter > 2) {
        background_counter = 0;
      }
      continue;
    }

    vert_val = scaleValue(vertical_speed);
    hor_val = scaleValue(horizontal_speed);

    // Text Displays
    vText();
    hText();
    fuelText();
    scoreText();

    // Update box positions according to their movement speeds
    // Vertical
    vertical_speed += gravity;
    rover_position[3] = myRound(vertical_speed);
    rover_position[1] += rover_position[3];

    // Horizontal
    rover_position[2] = myRound(horizontal_speed);
    rover_position[0] += rover_position[2];

    if ((rover_position[1] >= 0 && rover_position[1] <= 239)) {
      drawRover(rover_position[0], rover_position[1]);
    }

    landingPlusBoundaryCheck();
    int input = keyboard();

    // Text -> Out of Bounds
    if (rover_position[1] < -10) {
      char *str = "You are Lost in Space. Press Space to Start Again.";
      typeNextLevelStart(str);
      rover_position[0] = x;
      rover_position[1] = y;
      horizontal_speed = (double)speed;
      vertical_speed = (double)speed;
      continue;
    }

    // Up
    if (input == 1) {
      if ((rover_position[1] >= 0 && rover_position[1] <= 239)) {
        drawFlame(rover_position[0], rover_position[1]);
      }
      vertical_speed -= vertical_thrust;

      if (vertical_speed == 0) {
        vertical_speed = -1.4;
      }
      fuel--;
    }

    // Left
    else if (input == 2) {
      if ((rover_position[1] >= 0 && rover_position[1] <= 239)) {
        drawFlame(rover_position[0], rover_position[1]);
      }
      horizontal_speed -= horizontal_thrust;
      fuel--;
    }

    // Right
    else if (input == 3) {
      if ((rover_position[1] >= 0 && rover_position[1] <= 239)) {
        drawFlame(rover_position[0], rover_position[1]);
      }
      horizontal_speed += horizontal_thrust;
      fuel--;
    }

    // Down
    else if (input == 5) {
      vertical_speed += vertical_thrust;
      if (vertical_speed == 0) {
        vertical_speed = 0.5;
      }
    }

    // Limit speed to [-2,2]
    if (vertical_speed < -2) {
      vertical_speed = -2;
    } else if (vertical_speed > 2) {
      vertical_speed = 2;
    }

    if (horizontal_speed < -2) {
      horizontal_speed = -2;
    } else if (horizontal_speed > 2) {
      horizontal_speed = 2;
    }

    // Time Counter
    tcounter();
    // Altitude
    altitude();

    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  }

  return 0;
}